package math.ReconstructOriginalDigitsFromEnglish_423;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class SolutionTest {
    @Test
    public void test() {
        Solution s = new Solution();
        assertEquals("012", s.originalDigits("owoztneoer"));
        assertEquals("45", s.originalDigits("fviefuro"));
        assertEquals("0123456789", s.originalDigits("zeroonetwothreefourfivesixseveneightnine"));
        assertEquals("",
                s.originalDigits(""));
    }
}